import Account from './Account'
import {Router, Link } from 'react'

function Accounts(props) {
  return (
    <div className="card">
      {props.accounts.map((account) => (
        <div key={account.id}>
           <Account accounts={account}/> 
        </div>
      ))}
    </div>
  );
}

export default Accounts;
